import React from "react";
import { Button } from "reactstrap";
import {ToastContainer,toast} from "react-toastify";

function App() {
    const btnHandle =()=>{
      toast("first message");
    }
  return (
    <div>
      <ToastContainer />
      <h1>simple project</h1>
      <Button color="primary" onClick={btnHandle}>
        Click
      </Button>
    </div>
  );
}

export default App
